// Frontend Changes

import React, { useState, useEffect } from "react";
import "./Admin.css";
import { Navbar } from "../index";
import axios from "axios";

function Admin() {
  const [parcels, setParcels] = useState([]);
  const [editingRow, setEditingRow] = useState(null); // State to track the row being edited
  const [isAdding, setIsAdding] = useState(false); // State to track if adding a new parcel
  const [newParcel, setNewParcel] = useState({}); // State to track the new parcel being added

  useEffect(() => {
    axios
      .get("http://localhost:3333/Admin")
      .then((res) => {
        setParcels(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  const handleEdit = (index) => {
    setEditingRow(index);
  };

  const handleConfirm = (index) => {
    const editedParcel = parcels[index];
    axios
      .put(`http://localhost:3333/Admin/${editedParcel.parcel_ID}`, editedParcel)
      .then((res) => {
        setEditingRow(null); // Reset editing state after confirmation
      })
      .catch((err) => console.log(err));
  };

  const handleAddClick = () => {
    setIsAdding(true);
  };

  const handleAddParcel = () => {
    axios
      .post("http://localhost:3333/Admin", newParcel)
      .then((res) => {
        setParcels([...parcels, newParcel]); // Add the new parcel to the parcels list
        setNewParcel({}); // Clear the new parcel state
        setIsAdding(false); // Reset the adding state
      })
      .catch((err) => console.log(err));
  };

  return (
    <div>
      <div>
        <div className="Admin-Container">
          <div className="Admin-table-container">
            <button className="btn btn-success" onClick={handleAddClick}>
              Add +
            </button>
            {isAdding && ( // Render input fields only if adding a new parcel
              <table className="table">
                <thead>
                  <tr>
                    <th>Parcel ID</th>
                    <th>Weight</th>
                    <th>Type</th>
                    <th>Shipping Cost</th>
                    <th>Sender</th>
                    <th>Receiver</th>
                    <th>Branch</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>
                      <input
                        type="text"
                        value={newParcel.parcel_ID || ""}
                        onChange={(e) =>
                          setNewParcel({ ...newParcel, parcel_ID: e.target.value })
                        }
                      />
                    </td>
                    {/* Add input fields for other parcel attributes */}
                  </tr>
                </tbody>
              </table>
            )}
            <table className="table">
              <thead>
                <tr>
                  <th>Parcel ID</th>
                  <th>Weight</th>
                  <th>Type</th>
                  <th>Shipping Cost</th>
                  <th>Sender</th>
                  <th>Receiver</th>
                  <th>Branch</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {parcels.map((parcel, index) => (
                  <tr key={parcel.parcel_ID}>
                    {/* Other table row data */}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Admin;
